import React from 'react';
import { Typography, Carousel } from 'antd';
import { ALL_LANDS } from '../../data';
import { LandContainer } from './styles';

const { Title } = Typography;

const Land = () => {
  const chunk_size = 3;
  const chunks = ALL_LANDS.map( function(e,i){ 
    return i%chunk_size===0 ? ALL_LANDS.slice(i,i+chunk_size) : null; 
  }).filter(function(e){ return e; });

  console.log({ chunks });

  return (  
    <div>
      <Carousel style={{ width: '40%' }}>
        {chunks.map(chunk => (
          <div>
            <LandContainer>
              {chunk.map(land => (
                <div key={ land.title }>
                  <div className="land-card-img" />
                  <Title level={4}>{ land.title }</Title>
                  <p>{ land.description }</p>
                </div>
              ))}
            </LandContainer>
          </div>
        ))}
      </Carousel>
    </div>
  );
}

export default Land;
